import React, { useState } from "react";

function Car({ information }) {
  const [renderDetail, setRenderDetail] = useState(false);
  return (
    <div className="">
      <div>
        <div
          className="hover:p-[15%] bg-neutral-200 hover:duration-500 mx-5 rounded-sm"
          onMouseOver={() => {
            setRenderDetail(true);
          }}
          onMouseOut={() => {
            setRenderDetail(false);
          }}
        >
          {information.images.map((item, index) => {
            return (
              <div key={index} className="mx-auto">
                <img src={item[index]} alt={"Image Api not working"} />
              </div>
            );
          })}
          {renderDetail ? (
            <>
              <div>{information.id}</div>
              <div>{information.carName}</div>
              <div>{information.carPrice}</div>
            </>
          ) : (
            <></>
          )}
        </div>
      </div>
    </div>
  );
}

export default Car;
